 agonist for the management of type 2 diabetes . OBJECTIVE : To review the pharmacology , pharmacokinetics , safety , and efficacy of the glucagon-like peptide - 1 receptor agonist ( P0C6A0 RA ) , dulaglutide , in the treatment of type 2 diabetes mellitus ( T2D ) . DATA SOURCES : A PubMed search was completed to identify publications from 1947 to October 2014 using the search terms dulaglutide and LY2189265 . References were reviewed to identify additional resources . STUDY SELECTION AND DATA EXTRACTION : Articles were included if they evaluated the pharmacology , pharmacokinetics , safety , or efficacy of dulaglutide . DATA SYNTHESIS :

<div class="entities" style="line-height: 2.5; direction: ltr">O95361 inhibits proliferation and migration through regulation of interferon beta 1 in melanoma cells . High basal or induced expression of the tripartite motif protein , O95361 , leads to reduce cell growth and migration of neuroblastoma and skin squamous cell carcinoma cells . However , the role of O95361 in melanoma is currently unknown . O95361 protein levels were markedly reduced in human melanoma cell lines , compared with normal human epidermal melanocytes due to both DNA methylation and reduced protein stability . O95361 knockdown strongly increased cell migration in normal human epidermal melanocytes , while O95361 overexpression reduced cell migration and proliferation of melanoma cells in an interferon beta 1 ( IFNβ 1 ) - dependent manner . Chromatin immunoprecipitation assays revealed O95361 directly bound the IFNβ 1 gene promoter . Low level O95361 expression in 91 melanoma patient samples , strongly correlated with lymph node metastasis , and , predicted poor patient prognosis in a separate cohort of 170 melanoma patients with lymph node metastasis . The 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P15056

</mark>
 inhibitor , vemurafenib , increased O95361 protein levels in melanoma cells in vitro , and induced growth arrest in 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P15056

 - mutant melanoma cells in a O95361 - dependent manner . High levels of O95361 in melanoma tissues from patients treated with 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #CC9966); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>

<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

<div class="entities" style="line-height: 2.5; direction: ltr">Atypical teratoid / rhabdoid tumor arising in pleomorphic xanthoastrocytoma : a case report . Atypical teratoid / rhabdoid tumor ( AT / RT ) is a rare , highly malignant , true rhabdoid tumor in the central nervous system predominantly presenting in young children.AT/RT typically shows rhabdoid cells which can also be seen in other tumors , but it is differentiated from other tumors by the specific genetic alteration involving the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 gene . Only a few cases of AT / RT arising in low-grade glioma have been reported . A 13 - year-old girl presented with headache , dizziness , nausea and vomiting . A 4.7 cm cerebellar mass was found on Q9BWK5 . The mass was totally removed . Histologically , the tumor revealed two distinct morphologic appearances : central areas of AT / RT containing rhabdoid cells and sarcomatous component in the background of pleomorphic xanthoastrocytoma ( PXA ) . Immunohistochemically , PXA areas retained nuclear expression of INI - 1 and low Ki - 67 proliferation index , whereas AT / RT component showed loss of INI - 1 nuclear expression and markedly elevated Ki - 67 proliferation index . Epithelial membrane antigen (

 ) is expressed in mature sperm and has been shown to contribute to Cl ( - ) and HCO ( 3 ) ( - ) movements during capacitation . Furthermore , several members of the SLC 26 family have been described to form complexes with

 physically interact and that in Xenopus laevis oocytes and in CHO -

<div class="entities" style="line-height: 2.5; direction: ltr">Managing the underlying cause of cystic fibrosis : a future role for potentiators and correctors . Cystic fibrosis ( CF ) , a severe genetic disease , is caused by mutations that alter the structure and function of

 , a plasma membrane channel permeable to chloride and bicarbonate . Defective anion transport in CF irreversibly damages the lungs , pancreas , liver , and other organs . CF mutations cause loss of

</mark>
 function in multiple ways . In particular , class 3 mutations such as p . Gly 551Asp strongly decrease the time spent by

 protein and its transport from the endoplasmic reticulum to the plasma membrane ( trafficking defect ) . The deletion of phenylalanine 508 ( p . Phe 508del ) , the most frequent mutation among CF patients ( 70-90 % ) , destabilizes the

 protein , thus causing both a trafficking and a gating defect . These two defects can be overcome with drug-like molecules generically called correctors and potentiators , respectively . The potentiator Kalydeco ™ ( also known as

 or VX - 770 ) , developed by Vertex Pharmaceuticals , has been recently approved by the US FDA and the European Medicines Agency (

 ) for the treatment of CF patients carrying at least one

 allele with the p . Gly 551Asp mutation ( 2-5 % of all patients ) . In contrast , the corrector VX - 809 , which significantly improves p . Phe 508del -

 trafficking in vitro , is still under study in clinical trials . Because of multiple defects caused by the p . Phe 508del mutation , it is probable that rescue of the mutant protein will require combined treatment with correctors having different mechanisms of action . This review evaluates the status of experimental and clinical research in pharmacotherapy for the CF basic defect .</div>

<h2 style="margin: 0">12</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Genetic characterisation of circulating fetal cells allows non-invasive prenatal diagnosis of cystic fibrosis . OBJECTIVES : Cystic fibrosis ( CF ) is an autosomal recessive disease due to mutations in the cystic fibrosis transmembrane conductance regulator ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P13569
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) gene . The purpose of this study was to develop a molecular method to characterise both paternal and maternal 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P13569
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 alleles in DNA from circulating fetal cells ( CFCs ) isolated by ISET ( isolation by size of epithelial tumour / trophoblastic cells ) . METHODS : The molecular protocol was defined by developing the F508del mutation analysis and addressing it both to single trophoblastic cells , isolated by ISET and identified by short tandem repeats ( STR ) genotyping , and to pooled trophoblastic genomes , thus avoiding the risk of allele drop out ( Q96SZ5 ) . This protocol was validated in 100 leucocytes from F508del carriers and subsequently blindly applied to the blood ( 5 mL ) of 12 pregnant women , at 11 to 13 weeks of gestation , whose offspring had a 1/4 risk of CF . Ten couples were carriers of F508del mutation , while two were carriers of unknown 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P13569
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 mutations . RESULTS : Results showed that one fetus was affected , seven were heterozygous carriers of a 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P13569
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 mutation , and four were healthy homozygotes . These findings were consistent with those obtained by chorionic villus sampling ( CVS ) . CONCLUSION : Our data show that the ISET-CF approach affords reliable prenatal diagnosis ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01160
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) of cystic fibrosis and is potentially applicable to pregnant women at risk of having an affected child , thus avoiding the risk of iatrogenic miscarriage .</div>

 in spermatogensis through the HCO ( 3 ) ( - ) / Q96PN6 / DB02527 / CREB ( Q03060 ) pathway and the NF-κB /

 antagonist

 ) , anionic trypsinogen (

 ( GLP - 1Rx ) agonists might elicit unwelcome side effects and concerns have recently been raised about their safety . AREAS COVERED : Available evidence about safety , tolerability and potential adverse events relative to GLP - 1Rx agonists presently used . We searched the MEDLINE database using the terms : '

 agonists ' , ' Incretin therapy side effects ' , ' exenatide ' , ' liraglutide ' , ' exenatide long-acting release ' , ' lixisenatide ' . Articles were selected on the basis of the study design and importance , in the light of authors ' clinical experience and personal judgment . The main safety concern about GLP - 1Rx agonists use is the possible association with increased risk of pancreatitis and / or tumors . This concern stems mainly from limited observations in animal models not confirmed in similar studies . Furthermore , clinical studies reporting association between GLP - 1Rx agonist use and pancreatitis / cancer are marred by several biases and both clinical trials and post-marketing analyses failed to demonstrate a significant association . EXPERT OPINION : As stated by both FDA and

 , the safety concerns emerged so far about GLP - 1RX agonists should not affect present prescribing habits . Thus , although a strict data monitoring must be encouraged , they should not prevent access to the benefits of an innovative treatment , such as GLP - 1Rx agonists use , to a large diabetic population still confronted with unmet needs .</div>
